const data = [
    { myColor: 'red', borderColor: "black" },
    { myColor: "yellow", borderColor: "cyan" },
    { myColor: "cyan", borderColor: "green" },
    { myColor: "beige", borderColor: "black" },
    { myColor: "white", borderColor: "brown" }
]

export default data;
